                method: "subscribe",
                params: {
                    channel: "ticker",
                    symbol: ["BTC/USD"]
                }
            }));
        }, 300);
    };

    ws.onmessage = (event) => {
        console.log("ðŸ“©", event.data);
    };

    ws.onclose = () => console.log("ðŸ”Œ Disconnected");

